import React, { useState } from "react";




let Clock = ()=>{

   let state = useState();

   let time = new Date();
   time = time.toLocaleTimeString();

   let [theTime, setState] = useState(time);

   let getTime = ()=> {
       setState(theTime = time);
   }

   return(
       <>
         <h2> {time} </h2>
         <button onClick= {getTime}> Click me</button>
       </>
   );
}


export default Clock;
